import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter, Route, Redirect } from "react-router-dom";
import ButtonChallenge1 from "./buttonchallenge1.js";
import Game1 from "./Game1";
import Game from "./Game";
import TicTacToeGameTask1 from "./tictactoegame-task1.js";
import Game3 from "./Game3";
import Tictac from "./tictac";
import ButtonChallenge1aaaabbbbcccc from "./buttonchallenge1aaaabbbbcccc";
import HOme from "./pages/Home.jsx";
import About from "./pages/About.jsx";
import Contact from "./pages/Contact.jsx";
import Service from "./pages/Service.jsx";
//import Navbar1 from "./pages/Navbar1.jsx";
import Navbar from "./pages/Navbar.jsx";
import { Switch } from "react-router-dom";

const logo = "https://webmastershisar.com/wp-content/uploads/2017/03/wmh9.png";

class MenuNav1 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  myClickHandler = (event) => {
    let nam = event.target.name;
    let cshow = null;
    //alert("Button Component Is: " + nam);
    switch (nam) {
      case "Tictac":
        cshow = <Tictac />;
        break;
      case "TicTacToeGameTask1":
        cshow = <TicTacToeGameTask1 />;
        break;
      case "ButtonChallenge1":
        cshow = <ButtonChallenge1 />;
        break;
      case "Home":
        cshow = <HOme />;
        break;
      case "Game":
        cshow = <Game />;
        break;
      case "Game3":
        cshow = <Game3 />;
        break;
    }
    this.setState({ cshow: cshow });
  };

  render() {
    return (
      <div>
        <div>
          <a href="https://webmastershisar.com/">
            <img src={logo} alt="Logo" />
          </a>
        </div>

        <div style={{ backgroundColor: "#e0e0e0" }}>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Game"
            style={{
              backgroundColor: "lightblue",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Game.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Game1"
            style={{
              backgroundColor: "lightyellow",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            Game1.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Home"
            style={{
              backgroundColor: "lightpink",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            HOme.jsx <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="Tictac"
            style={{
              backgroundColor: "lightpink",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            tictac.js <br /> (Date: 8 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="TicTacToeGameTask1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            tictactoegame-task1.js <br /> (Date: 7 July 2020)
          </button>
          <button
            type="button"
            onClick={this.myClickHandler}
            name="ButtonChallenge1"
            style={{
              backgroundColor: "teal",
              width: "150px",
              height: "60px",
              margin: "20px",
            }}
          >
            ButtonChallenge1.js <br /> (Date: 4 July 2020)
          </button>
        </div>
        <div style={{ backgroundColor: "black" }}>
          <h3>Component Showing:</h3>
          <hr />
          {this.state.cshow}
        </div>
        <BrowserRouter>
          <Switch>
            <Route exact path="/" component={HOme} />
            <Route exact path="/about" component={About} />
            <Route exact path="/service" component={Service} />
            <Route exact path="/contact" component={Contact} />
            <Redirect to="/" />
          </Switch>
        </BrowserRouter>
      </div>
    );
  }
}

export default MenuNav1;
